import "../folder_css/css_one.css"

export default function Tab() {
  return (
    
      <div className="CSS-Tab">
                <img alt="Logo_APP" src={require("../folder_css/img/Logo_orange.png")} width="200" height="100"></img>
                <li> <a href="/San-Pham" ><img alt="Logo_APP" src={require("../folder_css/img/1.png")} style={{marginLeft: 20}}></img> Sản Phẩm </a> </li>
                <li> <a href="/Danh-Muc-San_Pham">Danh Mục</a> </li>
                <li> <a href="/Thuong-Hieu">Thương Hiệu</a> </li>
                <li> <a href="/Slider-Hinh-Anh-San-Pham">Nhiều Hình Ảnh </a> </li>
                <li> <a href="/Xuat-Xu">Xuất Xứ</a> </li>
                <li> <a href="/Lich-Su">Lịch Sử</a> </li>
                <li> <a href="/Thong-Bao">Thông Báo</a> </li>
                <li> <a href="/Tai-Khoan">Tài Khoản</a> </li>
      </div>
   
  );
}
